import React from "react";
import Header from "./Header";
import About from "./About";
import Skills from "./Skills";
import Projects from "./Projects";

import { Divider, Container } from "bumbag";

const Home = () => (
  <Container isFluid breakpoint="max-desktop" paddingX="0" margin="0">
    <Header />
    <Container isFluid padding={{'desktop': "2rem 12rem", 'tablet': "2rem 12rem", }}>
      <About />
      <Divider color="secondary" opacity="0.7" margin="0 -12rem" />
      <Skills />
      <Divider color="secondary" opacity="0.7" margin="0 -12rem" />
      <Projects />
    </Container>
  </Container>
);

export default Home;
